import React, {Component} from 'react';

class Login extends Component {

  render(){

    let content = (
      <div className="login-wrap">
        <div className="login-html">
          <input id="tab-1" type="radio" name="tab" className="sign-in" checked/><label htmlfor="tab-1" className="tab">Inicio de Sesión</label>
          <input id="tab-2" type="radio" name="tab" className="sign-up" checked/><label htmlfor="tab-2" className="tab">Crear Cuenta</label>
          <div className="login-form">
            <div className="sign-in-htm">
              <div className="group">
                <label htmlfor="user" className="label">Usuario</label>
                <input id="user" type="text" className="input"/>
              </div>
              <div className="group">
                <label htmlfor="pass" className="label">Contraseña</label>
                <input id="pass" type="password" className="input" data-type="password" />
              </div>
              <div className="group">
                <input id="check" type="checkbox" className="check" checked/>
              </div>
            </div>
          </div>
        </div>
      </div>
    );

    return content;
  }
}

export default Login;
